import React, { useState, useRef } from "react";
import axios from "axios";
import CodeEditor from "./CodeEditor";
import VoiceControl from "./VoiceControl";

function App() {
  const [transcript, setTranscript] = useState("");
  const [manualPrompt, setManualPrompt] = useState("");
  const [generatedCode, setGeneratedCode] = useState("");
  const [compileOutput, setCompileOutput] = useState("");
  const [recording, setRecording] = useState(false);

  const mediaRecorderRef = useRef(null);

  // ðŸŽ¤ Handle microphone recording
  const handleMicClick = async () => {
    if (recording) {
      mediaRecorderRef.current.stop();
      setRecording(false);
    } else {
      try {
        const stream = await navigator.mediaDevices.getUserMedia({ audio: true });
        const mediaRecorder = new MediaRecorder(stream, { mimeType: "audio/webm" });
        mediaRecorderRef.current = mediaRecorder;

        const chunks = [];
        mediaRecorder.ondataavailable = (e) => chunks.push(e.data);

        mediaRecorder.onstop = async () => {
          const blob = new Blob(chunks, { type: "audio/webm" });
          const formData = new FormData();
          formData.append("file", blob, "recording.webm");

          try {
            const response = await axios.post("http://localhost:5001/api/transcribe", formData, {
              headers: { "Content-Type": "multipart/form-data" },
            });
            setTranscript(response.data.transcript);
          } catch (err) {
            console.error("Transcription error:", err);
          }
        };

        mediaRecorder.start();
        setRecording(true);
      } catch (err) {
        console.error("Mic error:", err);
      }
    }
  };

  // ðŸ§‘â€ðŸ’» Generate code
  const handleGenerateCode = async () => {
    const prompt = manualPrompt || transcript;
    if (!prompt) return;

    try {
      const response = await axios.post("http://localhost:5000/api/generate-code", { prompt });
      setGeneratedCode(response.data.code);
    } catch (err) {
      console.error("Code generation error:", err);
    }
  };

  // â–¶ï¸ Compile code
  const handleCompileCode = async () => {
    if (!generatedCode) return;

    try {
      const response = await axios.post("http://localhost:5000/api/compile", {
        code: generatedCode,
        language: "python", // default
      });
      setCompileOutput(response.data.output);
    } catch (err) {
      console.error("Compile error:", err);
    }
  };

  return (
    <div className="flex flex-col items-center justify-center min-h-screen bg-gray-900 text-white p-6 space-y-6">
      <h1 className="text-3xl font-bold">ðŸŽ¤ CodeVoice</h1>

      {/* Mic + Transcript */}
      <button
        onClick={handleMicClick}
        className={`px-4 py-2 rounded-lg ${
          recording ? "bg-red-500" : "bg-green-500"
        }`}
      >
        {recording ? "Stop Recording" : "Start Recording"}
      </button>

      <textarea
        value={transcript}
        onChange={(e) => setTranscript(e.target.value)}
        placeholder="Transcript will appear here..."
        className="w-full max-w-2xl p-2 rounded-lg bg-gray-800 text-white"
      />

      {/* Manual Prompt */}
      <input
        type="text"
        value={manualPrompt}
        onChange={(e) => setManualPrompt(e.target.value)}
        placeholder="Type your prompt here..."
        className="w-full max-w-2xl p-2 rounded-lg bg-gray-800 text-white"
      />

      {/* Actions */}
      <div className="flex space-x-4">
        <button
          onClick={handleGenerateCode}
          className="px-4 py-2 bg-blue-600 rounded-lg"
        >
          Generate Code
        </button>
        <button
          onClick={handleCompileCode}
          className="px-4 py-2 bg-purple-600 rounded-lg"
        >
          Compile Code
        </button>
      </div>

      {/* Code Editor */}
      <CodeEditor code={generatedCode} setCode={setGeneratedCode} />

      {/* Compile Output */}
      {compileOutput && (
        <div className="w-full max-w-2xl bg-gray-800 p-4 rounded-lg">
          <h2 className="text-lg font-bold">Output:</h2>
          <pre className="whitespace-pre-wrap">{compileOutput}</pre>
        </div>
      )}

      {/* Voice Control */}
      <VoiceControl
        onGenerate={handleGenerateCode}
        onCompile={handleCompileCode}
        onSave={() => console.log("Save triggered")}
      />
    </div>
  );
}

export default App;
